import { EventForm } from '../components'
import { useLoaderData } from 'react-router-dom'

const EditEventPage = () => {

  const data = useLoaderData();
  const event = data.event;

  return (
    <>
      <EventForm event={data.event} />
    </>
  )
}

export default EditEventPage
